import "./App.css";
import logo from "./images/logo.jpeg";
function App() {
  return (
    <div className="bg-pink-50">
      <Header />
    </div>
  );
}

export default App;

function Header() {
  return (
    <div className="flex flex-row h-20 w-screen py-2">
      <img src={logo} alt="logo" className="justify-start"></img>
      <div className="flex flex-row bg-purple-200 space-x-10 ml-auto mr-20">
        <div className="">
          <h1>Features</h1>
        </div>
        <div>.</div>
        <div className="flex flex-row">
          <h1>FAQ</h1>
        </div>
        <div>.</div>
        <div className="flex flex-row">
          <h1>Pricing</h1>
        </div>
        <div>.</div>
        <div className="flex flex-row">
          <h1>Testimonials</h1>
        </div>
        <div>
          <button>Buy template</button>
        </div>
      </div>
    </div>
  );
}
